MrBuzzYT.on('guildCreate', guild => {
console.log(`New guild joined ${guild.name} (id: ${guild.id}). This guild has ${guild.memberCount} members`);
let channelID;
    let channels = guild.channels;
    channelLoop:


    for (let c of channels) {
        let channelType = c[1].type;
        if (channelType === "text") {
            channelID = c[0];
            break channelLoop;
        }
    }

    let channel = MrBuzzYT.channels.get(guild.systemChannelID || channelID);
    channel.send({
        embed: {
            color: 0x41e81b,
            author: { name: "Brandon-Dev#9784 For More Bots" },
            description: 'Bot Infomation.',
            fields: [{
                name: "Thank You For Ading Me To Your Server",
                value: "If You Need Any Support Please Join The Support Server",
            },
            {
                name: "Support Discord Server:",
                value: '[Click Me](https://discord.gg/2jQ2WjP)',
                inline: true
            }, 
            {
                name: "Bot Prefix:",
                value: config.prefix,
                inline: true
            },
            {
                name: "Developer:",
                value: "MrBuzz#9784",
                inline: true
            }]
        }
    });
});
